import React from "react";
import Card from './Card';
import "./index.css";
import Sdata from "./Sdata";


function Fav(){
  <>
  <h1>Below are the Example random Data:</h1>

 {Sdata.map((val) => {
  return(
    <Card 
    key ={val.id}
    imgsrc={val.imgsrc}
    title ={val.title} 
    sname ={val.sname} 
    href = {val.href}
 />
  );

 })}
  </>

}

